import time

import anyio
from httpx import AsyncClient

STRESS = 1000


async def base64url_face():
    async with AsyncClient() as test:
        started = time.time()
        print(f"started: {time.ctime()}")
        count = 0
        for _ in range(STRESS):
            response = await test.post(
                "http://localhost:8848/base64?urlsafe=false",
                json={
                    "modality": "face",
                    "type": "jpeg",
                    "data": "",
                },
            )
            # print(f"{response.content=}")
            assert response.status_code == 200
            count += 1

            resp = response.json()
            # print(f"{resp=}")

            assert {
                "results",
                "engine",
                "modality",
                "id",
                "timestamp",
            }.issubset(set(resp.keys()))

    assert count == STRESS
    print(f"ended: {time.ctime()}")
    eplase = time.time() - started
    print(f"elapse: {eplase}s")
    print(f"{count} requests made: {count/eplase:.2f} it/s")


async def main():
    await base64url_face()


if __name__ == "__main__":
    anyio.run(main)
